import React from 'react';
import {
    BodyContainer,
    Container,
    HeroContainer
} from '../components/StyledComponents/StyledComponents.jsx';
import Navigation from '../components/Navigation/Navigation.jsx';
import CoffeeOfTheDay from '../components/Coffee/CoffeeOfTheDay.jsx';
import Footer from '../components/Footer/Footer.jsx';
import Data from '../Data.js';
import styled from 'styled-components';

const CenteredContainer = styled(Container)`
    text-align: center;
    max-width: 800px;
    margin: 0 auto;
`;

const Coffee = () => {
    return (
        <>
            <Navigation page="coffee" />
            <BodyContainer>
                <HeroContainer
                    animate={{ opacity: 1 }}
                    initial={{ opacity: 0 }}
                    transition={{ duration: 2, delay: 1 }}
                    exit={{ opacity: 0 }}
                >
                    <CenteredContainer>
                        <h1>{Data.coffee.title}</h1>
                        <p>{Data.coffee.description}</p>
                        <CoffeeOfTheDay />
                    </CenteredContainer>
                </HeroContainer>
            </BodyContainer>
            <Footer />
        </>
    );
}

export default Coffee;
